import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class Item extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        const { tempArr } = this.props.itemArr;

        return (
            <div id="DV_Thing">
                <button>아이템 버튼</button>
                <button>tempArr</button>
            </div>
        );
    }
}


export default Item;
